import * as React from 'react'

import { colors } from '../../theme/theme';

import { Container, Title, Search } from './styles';



const SearchBar = () => (
  <Container>
    <Title>
      {"Github"}
    </Title>
    <Search color={colors.primary} />
  </Container>
);

export default SearchBar;
